import * as React from "react";
import AppBar from "@mui/material/AppBar";
import Box from "@mui/material/Box";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';

export default function ButtonAppBar() {
  return (
    <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static" elevation={0}>
        <Toolbar sx={{ background: "white", borderBottom: "1px solid black"}}>
          <Box
            sx={{
              display: "flex",
              flexDirection: "row",
              justifyContent: "space-between",
              width: "100%"
            }}
          >
            <div sx={{display: "flex", justifyContent: "space-between"}}>
            <Typography sx={{fontFamily: "Inter", fontSize: 16, color: "#667085", fontWeight: "bold"}}>Programs<KeyboardArrowDownIcon/></Typography>
            <Typography className="pagetitle">About</Typography>
            <Typography className="pagetitle">FAQ</Typography>
            <Typography className="pagetitle">Team</Typography>
            <Typography className="pagetitle">Sponsors</Typography>
            </div>
          </Box>
        </Toolbar>
      </AppBar>
    </Box>
  );
}
